INSERT INTO `GUIDEENTITY` (`ID`, `SIMULATION_ID`, `BYTES`, `DESCRIPTION`, `NAME`, `NOTIFICATIONHEADER`, `NOTIFICATIONMESSAGE`, `REMARK`, `SORTORDER`)
VALUES
	(1,2,NULL,NULL,'Price Positioning','','Before make your decision, go to Sales Fundamentals and read Price Positioning section.','<p>Price is one of the core element of 6P. A concious shopper always check the price before buying process. Thats why every single company must check their products prices in the market.</p><p>Price positioning is restructuring a products price by considering competition. While index to market average can bu used, index to biggest competitor can be used for positioning. However, possible changes in profitability and sales volume should be well predicted before positioning.</p><p>Checking prices in the market and regulating them will be preferable for business results. Companies have 3 main purpose, USG-GM-MS, consider that they are related with eachother. For example; the lower prices you offer for market share gain, the lower gross margin you will have after that.</p><p><img src=\"data:image/jpeg;base64,\"></p>',1),
	(2,2,NULL,NULL,'Volume Hunting','','Before make your decision, go to Sales Fundamentals and read Volume Hunting section.','<p>Volume Hunting is a mechanism where company sells products at favorable costs and renounces profitability in order to increase products household penetration</p><p>Favorable costs to customer bring aggresive prices on shelf and it is likely to see an increase in market share and distribution. However, since profitability will be low during activity; timing, number of products and discount rates must be well organized because of gm target.</p><p><img src=\"data:image/jpeg;base64,\"></p>',2),
	(3,2,NULL,NULL,'Promotion','','Before make your decision, go to Sales Fundamentals and read Promotion section.','<p>Promotion is a mechanism to impress shopper at points where shoppers and customers meet (inserts, in store visuals, virtual stores..). Some promotion tools are as follows.</p><p>Gift Promotion(off pack): Giving away gifts for each product purchase on the cash-point</p><p><img src=\"data:image/jpeg;base64,\"></p><p>Gift Copack Promotion: Mechanism where main product and gift are in the same package and displayed on the shelf as a copack.</p><p><img src=\"data:image/jpeg;base64,\"></p><p>Price Promotion: Promotion where regular shelf prices are lowered during promotion period.</p><p><img src=\"data:image/jpeg;base64,\"></p>',3),
	(4,2,NULL,NULL,'Team Management','','Before make your decision, go to Sales Fundamentals and read Team Management section.','<p>Team management is the ability of an individual or an organization to administer and coordinate a group of individuals to perform a task. Team management involves teamwork, communication, objective setting and performance appraisals. Moreover, team management is the capability to identify problems and resolve conflicts within a team. There are various methods and leadership styles a team manager can take to increase personnel productivity and build an effective team.</p><p><img src=\"data:image/jpeg;base64,\"></p>',4),
	(5,2,NULL,NULL,'Display','','Before make your decision, go to Sales Fundamentals and read Display section.','<p>Display is a method where products are exhibited to attract consumer in order to increase sales.</p><p>There are some valuable areas in stores which aims sell-out growth.</p><p>Some examples about these areas:</p><p><img src=\"data:image/jpeg;base64,\"></p>',5);
INSERT INTO `GUIDEENTITY` (`ID`, `SIMULATION_ID`, `BYTES`, `DESCRIPTION`, `NAME`, `NOTIFICATIONHEADER`, `NOTIFICATIONMESSAGE`, `REMARK`, `SORTORDER`)
VALUES
	(6,2,NULL,NULL,'Planogram','','Before make your decision, go to Sales Fundamentals and read Planogram section.','<p>For hair categorys shelf assorment, standing in front of shelf, prices of products are decreasing from left to right. This method is called PIANO.</p><p>Eye-hand level is the most precious area of shelf. Also, it is important to place products by their sizes.</p><p><img src=\"data:image/jpeg;base64,\"></p>',6),
	(7,2,NULL,NULL,'E-Commerce Investment','','Before make your decision, go to Sales Fundamentals and read E-Commerce Investment section.','<p>Retail E-commerce sales are sales of goods and services where the business takes place over the Internet, an extra-net, Electronic Data Interchange (EDI) network, or other online system. Payment may or may not be made online. Business in this context is defined as an order placed by the buyer or price and terms of sale negotiated.</p><p>For our company, being available at customers e-commerce system improves brand awareness, enables consumer to reach our products easily.</p><p>Since online shopping has reached 10m people, being active at this platform will bring increase in USG and Markes Share.</p><p><img src=\"data:image/jpeg;base64,\"></p>',7),
	(8,2,NULL,NULL,'Listing','','Before make your decision, go to Sales Fundamentals and read Listing section.','<p>Listing is openning a product to sales permanently. Although listing a product seems beneficial, if product does not perform well, delisting will be thought and customers confidence may hurt.</p><p>Decrease in profitability may be observed for to be listed product as it requires marketing investment. Therefore, variables like return on sales, sustainability and profitability should be balanced and optimized during listing.</p>',8),
	(9,2,NULL,NULL,'Delisting','','Before make your decision, go to Sales Fundamentals and read Delisting section.','<p>Delisting is closing a product to sales permanently. This can happen because of product perception, unsuitability of product to shopper of customer. Likewise, low performances in market share, turnover and profitability can cause that. When a product is delisted, there will be loss of sales. Therefore, balance should be preserved. An alternative product can be proposed for delisted one, or a profitable products face area may be increased.</p>',9);
